import React from "react";
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import { useState } from 'react';

function CreateItem() {
  const [company, setCompany] = useState('');
  const [description, setDescription] = useState('');
  const [message, setMessage] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    axios.post('http://localhost:8000/market/', { company })
      .then(() => {
        setCompany('Item created successfully!');
      })
      .catch((error) => {
        setCompany('An error occurred while creating the item.');
        console.error(error);
      });
  };
  return (
    <div>
      <h1>Market Competitor Analysis</h1>
      <TextField id="outlined-basic" value = {company} label="Outlined" variant="outlined" onChange={(e) => setCompany(e.target.value)}/>
      <Button variant="contained"
      onClick={handleSubmit}
      >Contained</Button>
    </div>
  );
}
